import React from "react";

const Comment = (props) => {
  const { createdDate, createdBy, text } = props;
  return (
    <div className="comment-bubble">
      <span style={{ fontWeight: "bold" }}>
        {createdBy.name}:{"  "}
      </span>
      {text}
    </div>
  );
};

export default Comment;
